    border-radius: 5px;
    cursor: pointer;
    :hover {
      transition: 0.5s;
      opacity: 0.3;
      box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.123);
    }
  }
  h2 {
    margin: 30px auto;
